import'./arrivals.css'



export default function Arrivals(){

    return(
        <section className="arrivals">
            <div className="conteiner">
                <div className="arrivals_header">
                    <h2 className="title_2">NEW arrivals</h2>
                </div>
                <div className="arrivals_cards"></div>
            </div>
        </section>

    )}
